var (
	BX               []interface{}
	pageReadyChannel = make(chan bool)
	bxReadyChannel   = make(chan bool)
	proxy            string
	page             playwright.Page
	Port             = 8081
)

//goland:noinspection GoUnhandledErrorResult,SpellCheckingInspection,HttpUrlsUsage
func init() {
	playwright.Install(&playwright.RunOptions{
		Browsers: []string{"firefox"},
	})

	pw, err := playwright.Run()
	if err != nil {
		log.Fatal(err.Error())
		return
	}

	browserTypeLaunchOptions := playwright.BrowserTypeLaunchOptions{}
	proxy = os.Getenv("PROXY")
	if proxy != "" {
		bypass := "127.0.0.1"
		browserTypeLaunchOptions.Proxy = &playwright.Proxy{
			Server: &proxy,
			Bypass: &bypass,
		}
	}

	port := os.Getenv("PORT")
	if port != "" {
		envPort, _ := strconv.Atoi(port)
		Port = envPort
	}

	browser, err := pw.Firefox.Launch(browserTypeLaunchOptions)
	if err != nil {
		log.Fatal(err.Error())
		return
	}

	page, _ = browser.NewPage()
	page.Route("https://client-api.arkoselabs.com/fc/gt2/public_key/35536E1E-65B4-4D96-9D97-6ADB7EFF8147", func(route playwright.Route) {
		postData, _ := route.Request().PostData()
		split := strings.Split(postData, "=")
		bda := ""
		userAgent := ""
		for index, data := range split {
			switch index {
			case 1:
				rawBDA, _ := url.QueryUnescape(data)
				bda = getParam(rawBDA)
			case 4:
				rawUserAgent, _ := url.QueryUnescape(data)
				userAgent = getParam(rawUserAgent)
			}
		}
		bx, _ := getBX(bda, userAgent)
		BX = bx

		route.Continue()
		bxReadyChannel <- true
	})

	go func() {
		<-pageReadyChannel
		clickButton(page)
	}()

	pageReadyChannel <- true

	go func() {
		<-bxReadyChannel

		// fix 403, the first request will always return 403
		data, _ := json.Marshal(BX)
		funcaptcha.GetOpenAITokenWithBx(string(data))

		// this request is to check to arkose token is valid
		token, _ := funcaptcha.GetOpenAITokenWithBx(string(data))
		if !strings.Contains(token, "sup") {
			logger.Error("Captcha is detected, please update environment variable PORT to a new port.")
			return
		}

		logger.Info(fmt.Sprintf("Service arkose-token-api is ready: %d", Port))
	}()

	go func() {
		for {
			time.Sleep(time.Hour)
			clickButton(page)
			<-bxReadyChannel
		}
	}()
}

//goland:noinspection GoUnhandledErrorResult
func clickButton(page playwright.Page) {
	page.Goto(fmt.Sprintf("http://127.0.0.1:%d", Port))
	button, _ := page.QuerySelector("#click")
	time.Sleep(time.Second) // must sleep 1s here
	button.Click()
}

func getParam(param string) string {
	return param[0:strings.LastIndex(param, "&")]
}

func getBX(bda, userAgent string) ([]interface{}, error) {
	ctIvSRaw, _ := base64.StdEncoding.DecodeString(bda)
	ctIvS := string(ctIvSRaw)

	bx, err := page.Evaluate(fmt.Sprintf(`() => {
			%s
			%s
			%s
		}`,
		funcaptchaApiJS,
		"let time = new Date().getTime() / 1000;",
		fmt.Sprintf(`return JSON.parse(ALFCCJS.decrypt('%s', "%s" + Math.round(time - (time %% 21600))));`, ctIvS, userAgent),
	), nil)
	if err != nil {
		logger.Error("failed to get bx.")
		return nil, err
	}

	return bx.([]interface{}), nil
}
